<html class=" -webkit-"><head><meta charset="UTF-8">

<script src="http://s.codepen.io/assets/libs/prefixfree.min.js"></script>
<style>
a{
  color: inherit;
  text-decoration: none;
}
a:hover{
  -webkit-transition: all 0.4s;
          transition: all 0.4s;
  -webkit-transform: rotate3d(1,0,1, 90deg);
  transform: rotate3d(1,0,1, 90deg);
}
body.initial{
  color: black;
}
body.initial span:hover{
  color: white;
}
body{
  color: white;
  font-family: Helvetica;
  transition: all 0.8s;
  -webkit-transition: all 0.8s;
}
body.invert:not(.grid){
  background-color: black;
  color: black;
}
.invert span, .grid span{
  border-color: white;
  background-color: black;
}
.invert span:hover, .grid span:hover{
  border-color: white;
}


.tiles span{
    border: solid 1px black;
}
.invert.tiles span{
    border: solid 1px white;
    border-color: white;
}
.invert.tiles span:hover{
    border: solid 10px white;
}

span {
  width:20px;
  height:20px;
  overflow: hidden;
  display: inline-block;
  float: sleft;
  margin: 0px;
  opacity: 0.8;
  border-style: solid;
  border-width: 0px ;
  border-color: grey;
  background-color: white;
  transition:  0.8s  0.2s;
  -webkit-transition:  0.8s  0.2s;
  border-radius: 0px;
  position-: relative;
  box-sizing: border-box;
  -webkit-transform: rotate3d(1,1,1,0deg);
  transform: rotate3d(1,1,1,0deg);
}
span:hover {
  opacity: 1;
  transition:  0s;
  -webkit-transition:  0s;
  border: solid 10px #000000;
}
span:active {
  -webkit-transform: rotate3d(0,1,1,90deg);
  transform: rotate3d(0,1,1,90deg);
  -webkit-transition:  0.1s;
} 
</style>
<script>
window.onload = function(){

  var body  = document.getElementsByTagName('body')[0];
  var count = 0;
  var classes = ['grid', 'tiles', ['invert', 'tiles'], 'tiles', ['invert', 'grid']];
    body.onmousedown = function(){
      var oldClasses = typeof classes[count] == 'string' ?  new Array(classes[count]) : classes[count];
      for(c in oldClasses)
      {
        body.classList.remove(oldClasses[c]);
      }
      count++;
      var nextClasses = typeof classes[count] == 'string' ?  new Array([classes[count]]) : classes[count];
      for(c in nextClasses)
      {
        body.classList.add(nextClasses[c]);
      }
        count = count%classes.length;
      }
  setTimeout(function(){
    body.classList.remove('initial');
  }, 2000);
}
</script>
